The vulnerability is fixed by using a PreparedStatement with a parameterized query instead of concatenating user input directly into the SQL statement. This prevents SQL injection by properly escaping and handling the user input.
```suggestion
public void executeSqlStatementNoncompliant(HttpServletRequest request, java.sql.Connection connection) {
        final String favoriteColor = request.getParameter("favoriteColor");
        try {
            String sql = "SELECT * FROM people WHERE favorite_color = ?";
            java.sql.PreparedStatement preparedStatement = connection.prepareStatement(sql);
            preparedStatement.setString(1, favoriteColor);
            // Fixed: Using PreparedStatement with parameterized query
            preparedStatement.executeQuery();
        } catch (java.sql.SQLException e) {
            throw new RuntimeException(e);
